import { func } from "prop-types";
import React, { useState } from "react";
import ReactDOM from "react-dom";
import './buildingform.css';
import Select from 'react-select'

export default function BuildingForm (){
  let aaaa = (props) =>
  {
    return(
      <select className="add-building-screen-select">
      {props.map((a) =>
        <option value={a.value}>{a.text}</option>
      )}
      </select>
    )
  }
  let province = 
  [
    {value: 1, text: "Hà Nội"},
    {value: 2, text: "Thành phố Hồ Chí Minh"},
    {value: 3, text: "Đà Nẵng"}
  ]
  let district = 
  [
    {value: 1, text: "1"},
    {value: 2, text: "2"},
    {value: 3, text: "3"}
  ]
  let communte = 
  [
    {value: 1, text: "1"},
    {value: 2, text: "2"},
    {value: 3, text: "3"}
  ]
  let floor = 
  [
    {value: 1, text: "1"},
    {value: 2, text: "2"},
    {value: 3, text: "3"}
  ]
  let checkbox = (name, text) =>
  {
    return(
      <div className="checkbox-item">
        <span className="checkbox-text textsm">{text}</span>
        <input
          type="checkbox"
          className="checkbox"
          name={name}
        />
      </div>
    )
  }
  return (
    <div className="add-building-screen-main">
      <span className="add-building-screen-text textxlsemibold">Thêm toà nhà</span>
      <form className="add-building-screen-list">
        <div className="add-building-screen-floors2">
          <span className="add-building-screen-text30 textmdsemibold">Số tầng</span>
          <select className="add-building-screen-select">
            {floor.map((floor) =>
              <option value={floor.value}>{floor.text}</option>
            )}
          </select>
        </div>
        <div className="add-building-screen-row">
          <div className="add-building-screen-floors">
            <span className="add-building-screen-text02 textmdsemibold">Quận/Huyện</span>
            <select className="add-building-screen-select">
              {district.map((district) =>
                <option value={district.value}>{district.text}</option>
              )}
            </select>
          </div>
          <div className="add-building-screen-floors" style={{left: 267}}>
            <span className="add-building-screen-text02 textmdsemibold">Phường/Xã</span>
            <select className="add-building-screen-select">
              {communte.map((communte) =>
                <option value={communte.value}>{communte.text}</option>
              )}
            </select>
          </div>
        </div>
        <div className="add-building-screen-service">
          <div className="add-building-screen-checkbox-area">
            <div>
              {checkbox("electric", "Điện")}
              {checkbox("wifi", "Wifi")}
            </div>
            <div>
              {checkbox("water", "Nước")}
              {checkbox("park", "Giữ xe")}
            </div>
          </div>
          <span className="add-building-screen-text11 textmdsemibold">Dịch vụ</span>
        </div>
        <div className="add-building-screen-row1">
          <span className="add-building-screen-text13 textmdsemibold">Mô tả</span>
          <div className="add-building-screen-textarea">
            <span className="add-building-screen-text14 textmd">Mô tả</span>
          </div>
        </div>
        <div className="add-building-screen-row2">
          <span className="add-building-screen-text16 textmdsemibold">Thêm ảnh</span>
          <button className="add-building-screen-button">
            <span className="add-building-screen-text18">Nhấn để thêm ảnh</span>
          </button>
        </div>
        <div className="add-building-screen-name">
          <span className="add-building-screen-text22 textmdsemibold">Tên toà nhà</span>
          <input
            type="text"
            placeholder="Tên tòa nhà"
            className="add-building-screen-input"
          />
        </div>
        <div className="add-building-screen-name1">
          <span className="add-building-screen-text22 textmdsemibold">Số, đường</span>
          <input
            type="text"
            placeholder="Số, đường"
            className="add-building-screen-input"
          />
        </div>
        <div className="add-building-screen-name2">
          <span className="add-building-screen-text26 textmdsemibold">Tỉnh/Thành</span>
          <select className="add-building-screen-select">
            {province.map((province) =>
              <option value={province.value}>{province.text}</option>
            )}
          </select>
        </div>
        <button className="add-building-screen-small-secondary-button">
          <span className="add-building-screen-text28 textsmsemibold">Thêm toà nhà</span>
        </button>
      </form>
    </div>
  )
}
